    ClinicianProceeduresComponent.prototype.buildChartPredictor = function () {
        var _this = this;
        if (this.duration) {
            var user_id;
            var clinic_id;
            this.clinicianproceeduresService.PredictorRatio(this.clinic_id, this.startDate, this.endDate, this.duration).subscribe(function (data) {
                if (data.message == 'success') {
                    _this.predictedChartData1 = [];
                    _this.predictedChartData2 = [];
                    _this.predictedChartData3 = [];
                    _this.predictedChartLabels1 = [];
                    _this.predictedChartLabels = [];
                    _this.predictedChartData[0]['data'] = [];
                    _this.predictedChartD[0] = [];
                    _this.predictedChartD[1] = [];
                    _this.predictedChartD[2] = [];
                    _this.predictedT[0] = 0;
                    _this.predictedT[1] = 0;
                    _this.predictedT[2] = 0;
                    _this.predictedChartL[0] = [];
                    _this.predictedChartL[1] = [];
                    _this.predictedChartL[2] = [];
                    _this.predictedTotal0 = 0;
                    _this.predictedTotal1 = 0;
                    _this.predictedTotal2 = 0;
                    _this.predictedPreviousTotal1 = 0;
                    _this.predictedPreviousTotal2 = 0;
                    _this.predictedPreviousTotal3 = 0;
                    _this.predictedChartLabels1 = [];
                    _this.predictedPreviousAverage1 = 0;
                    _this.predictedPreviousAverage2 = 0;
                    _this.predictedPreviousAverage3 = 0;
                    _this.predictedTP[0] = 0;
                    _this.predictedTP[1] = 0;
                    _this.predictedTP[2] = 0;
                    data.data.forEach(function (res, key) {
                        res.forEach(function (result) {
                            _this.predictedChartD[key].push(result.ratio);
                            _this.predictedChartL[key].push(result.provider);
                            _this.predictedT[key] = _this.predictedT[key] + parseInt(result.ratio);
                            _this.predictedTP[key] = _this.predictedTP[key] + parseInt(result.ratio_ta);
                        });
                    });
                    _this.predictedTotalAverage1 = _this.predictedT[0] / _this.predictedChartD[0].length;
                    _this.predictedTotalAverage2 = _this.predictedT[1] / _this.predictedChartD[1].length;
                    _this.predictedTotalAverage3 = _this.predictedT[2] / _this.predictedChartD[2].length;
                    _this.predictedPreviousAverage1 = _this.predictedTP[0] / _this.predictedChartD[0].length;
                    _this.predictedPreviousAverage2 = _this.predictedTP[1] / _this.predictedChartD[1].length;
                    _this.predictedPreviousAverage3 = _this.predictedTP[2] / _this.predictedChartD[2].length;
                    _this.predictedChartData[0]['data'] = _this.predictedChartD[0];
                    _this.predictedChartLabels = _this.predictedChartL[0];
                    _this.predictedTotal = _this.predictedT[0];
                    if (_this.predictedTotalAverage1 >= _this.predictedPreviousAverage1)
                        _this.predictedTotalAverageTooltip1 = 'up';
                    if (_this.predictedTotalAverage2 >= _this.predictedPreviousAverage2)
                        _this.predictedTotalAverageTooltip2 = 'up';
                    if (_this.predictedTotalAverage3 >= _this.predictedPreviousAverage3)
                        _this.predictedTotalAverageTooltip3 = 'up';
                    _this.predictedMax = Math.max.apply(Math, _this.predictedChartData[0]['data']);
                }
            }, function (error) {
                _this.warningMessage = "Please Provide Valid Inputs!";
            });
        }
    };
