    //netProfit
    FinancesComponent.prototype.netProfit = function () {
        var _this = this;
        var user_id;
        var clinic_id;
        this.netProfitTrendIcon = "down";
        this.netProfitTrendTotal = 0;
        this.financesService.NetProfit(this.clinic_id, this.startDate, this.endDate, this.duration).subscribe(function (data) {
            if (data.message == 'success') {
                _this.netProfitVal = data.data.total_net_profit;
                _this.netProfitTrendTotal = data.data.total_net_profit_ta;
                if (_this.netProfitVal >= 0)
                    _this.netProfitIcon = "";
                else
                    _this.netProfitIcon = "-";
                _this.netProfitVal = Math.abs(_this.netProfitVal).toFixed(2);
                if (_this.netProfitVal >= _this.netProfitTrendTotal)
                    _this.netProfitTrendIcon = "up";
            }
        }, function (error) {
            _this.warningMessage = "Please Provide Valid Inputs!";
        });
    };
