    //expenses
    FinancesComponent.prototype.categoryExpenses = function () {
        var _this = this;
        var user_id;
        var clinic_id;
        this.expensescChartTrendIcon = "down";
        this.expensescChartTrendTotal = 0;
        this.financesService.categoryExpenses(this.clinic_id, this.startDate, this.endDate, this.duration).subscribe(function (data) {
            if (data.message == 'success') {
                _this.pieChartLabels = [];
                _this.pieChartLabelsres = [];
                _this.single = [];
                _this.pieChartDatares = [];
                _this.pieChartDataPercentres = [];
                data.data.forEach(function (res, key) {
                    var temp = { name: '', value: 1 };
                    temp.name = res.meta_key;
                    temp.value = res.expenses;
                    _this.single.push(temp);
                    _this.single[key].value = Math.abs(res.expenses_percent).toFixed(1);
                    _this.pieChartDatares.push(res.expenses);
                    _this.pieChartDataPercentres.push(Math.abs(res.expenses_percent).toFixed(1));
                    _this.pieChartLabelsres.push(res.meta_key);
                    _this.pieChartTotal = _this.pieChartTotal + parseInt(res.expenses);
                });
                _this.expensescChartTrendTotal = data.data_ta;
                if (Math.abs(_this.pieChartTotal) >= Math.abs(_this.expensescChartTrendTotal))
                    _this.expensescChartTrendIcon = "up";
                _this.pieChartData = _this.pieChartDatares;
                _this.pieChartLabels = _this.pieChartLabelsres;
            }
        }, function (error) {
            _this.warningMessage = "Please Provide Valid Inputs!";
        });
    };
